import{_ as n,o as i,c as s,b as t,e as r,a as e,d as a,r as d}from"../app.4a7976c2.mjs";const c="/datum-documentation/assets/\u5207\u6362\u7F51\u7EDC.d2b7d6f5.png",l="/datum-documentation/assets/\u9009\u62E9\u94B1\u5305.ca08ce91.png",m="/datum-documentation/assets/\u94B1\u5305\u767B\u5F55\u7B7E\u540D.66ff5e4f.png",p="/datum-documentation/assets/\u7CFB\u7EDF\u6982\u51B5.bc2903a8.png",h="/datum-documentation/assets/\u6DFB\u52A0\u6570\u636E.9efc696f.png",u="/datum-documentation/assets/\u6DFB\u52A0\u6570\u636E-2.60c232c0.png",g="/datum-documentation/assets/\u6570\u636E\u7BA1\u7406.8a2a475f.png",f="/datum-documentation/assets/\u53D1\u5E03\u51ED\u8BC1.236b20d4.png",b="/datum-documentation/assets/\u9009\u62E9\u5143\u6570\u636E.70c05389.png",y="/datum-documentation/assets/Metamask\u7B7E\u540D\u786E\u8BA4-1.0e317290.png",k="/datum-documentation/assets/Metamask\u7B7E\u540D\u786E\u8BA4-1.1.f4f6b4d1.png",w="/datum-documentation/assets/\u7ED1\u5B9A\u6570\u636E.5a36e3eb.png",_="/datum-documentation/assets/\u4FEE\u6539\u6D88\u8017\u91CF.1208254f.png",v="/datum-documentation/assets/\u8BBE\u7F6E\u5151\u6362\u4EF7\u683C.6716441f.png",D="/datum-documentation/assets/Metamask\u7B7E\u540D\u786E\u8BA4-2.baf38f0f.png",C="/datum-documentation/assets/Metamask\u7B7E\u540D\u786E\u8BA4-3.7819557a.png",M="/datum-documentation/assets/\u5BFC\u5165\u6D41\u52A8\u6027.8ad4bc75.png",z="/datum-documentation/assets/\u67E5\u770B\u6D41\u52A8\u6027.7f9e41fc.png",A="/datum-documentation/assets/\u7ED1\u5B9A\u6570\u636E-1.c7b370fc.png",N="/datum-documentation/assets/\u521B\u5EFA\u51ED\u8BC1.dda86cb6.png",T="/datum-documentation/assets/Metamask\u7B7E\u540D\u786E\u8BA4-4.1a149cb0.png",x="/datum-documentation/assets/\u4E0A\u67B6.58497e24.png",S="/datum-documentation/assets/\u51ED\u8BC1\u8BE6\u60C5.edeb3467.png",P={},O=e('<h1 id="datum-network-help-document-for-users" tabindex="-1"><a class="header-anchor" href="#datum-network-help-document-for-users" aria-hidden="true">#</a> <strong>Datum-network Help Document (for Users)</strong></h1><p>[TOC]</p><h2 id="overview" tabindex="-1"><a class="header-anchor" href="#overview" aria-hidden="true">#</a> Overview</h2><p>Datum-network is a distributed privacy computing network based on the underlying capabilities of privacy AI.</p><p>Datum-network\u2019s console provides an interface through which data providers and computing power providers can manage raw data and computing resources.</p><p>Users can deploy their Datum-network node locally to connect to the network. In addition, data providers can manage their data in a more reliable local environment, while computing power providers can share their computing power to improve the network\u2019s computing performance and earn profits.</p><p>Users can also directly link to nodes already in the network to publish and manage data assets. Nodes with open connections are:</p><ul><li>OrgA\uFF1A[http://8.219.63.100</li><li>OrgB\uFF1A[http://8.219.62.193</li><li>OrgC\uFF1A[http://8.219.4.134</li></ul><p>For users\u2019 convenience, Datum-network offers five data sets that they can publish and use. Download link:</p><p>Finance: http://testdownload.datumtechs.com/datum/dataset/Finance.zip Media Advertisement: http://testdownload.datumtechs.com/datum/dataset/MediaAdvertising.zip Medical &amp; Health: http://testdownload.datumtechs.com/datum/dataset/Medicalhealth.zip Public Service: http://testdownload.datumtechs.com/datum/dataset/Publicservice.zip Transportation: http://testdownload.datumtechs.com/datum/dataset/Transportation.zip</p>',10),E=a("Users can claim test tokens via the following address: "),U={href:"https://faucet.platon.network/faucet/",target:"_blank",rel:"noopener noreferrer"},F=a("PlatON"),q=e('<h2 id="console-login" tabindex="-1"><a class="header-anchor" href="#console-login" aria-hidden="true">#</a> <strong>Console Login</strong></h2><p>You can directly log in to the console through MetaMask, without additional registration.</p><p>1.Select an open-connected node address in Chrome and enter the home page of the Datum-network console; click on [Metamask], and select [Switch Network] in the pop-up window to switch the network to the PlatON DevNet (development network).</p><img src="'+c+'" alt="\u5207\u6362\u7F51\u7EDC" style="zoom:50%;"><p>2.Once the network is switched to the PlatON DevNet, choose your account for the connection.</p><img src="'+l+'" alt="\u9009\u62E9\u94B1\u5305" style="zoom:50%;"><p>3.After the connection is confirmed, click on [Signature] and complete the authorization process to go to the console.</p><img src="'+m+'" alt="\u94B1\u5305\u767B\u5F55\u7B7E\u540D" style="zoom:50%;"><h2 id="overview-of-the-console" tabindex="-1"><a class="header-anchor" href="#overview-of-the-console" aria-hidden="true">#</a> <strong>Overview of the Console</strong></h2><p>The console shows the system resources of the connected node, including CPU, memory, bandwidth, and fee consumption, as well as the tasks performed by the node, which covers the amount of data published and the overview of computing tasks.</p><img src="'+p+'" alt="\u7CFB\u7EDF\u6982\u51B5" style="zoom:50%;"><h2 id="my-data" tabindex="-1"><a class="header-anchor" href="#my-data" aria-hidden="true">#</a> <strong>My Data</strong></h2><p>Through \u201CMy Data\u201D, you can manage the original data to be capitalized. For instance, you can add/extract metadata (data information that can be publicly displayed) and issue credentials.</p><p><strong>[Data Addition]</strong></p><p>(1) Click on [My Data] - [Data Addition] to go to the page for adding data and extracting metadata.</p><img src="'+h+'" alt="\u6DFB\u52A0\u6570\u636E" style="zoom:50%;"><p>(2) Select the local data file to be used (only CSV files are supported at the moment), then click on [Upload]. The system will automatically read the \u201CField\u201D and \u201CData Type\u201D contained in the original data, collectively referred to as metadata. Users can modify the usage scenarios: private computing, non private computing (data can only be used in the selected algorithm (private computing/non private computing), and multiple choices are supported), as well as the metadata information read, and select &quot;Visible to the public&quot;.</p><img src="'+u+'" alt="\u6DFB\u52A0\u6570\u636E-2" style="zoom:50%;"><p>(3) After the basic information filled in and confirmed the metadata, you should then click on [Submit] at the bottom of the page to upload the metadata to the present node and enter the [Data Management] module.</p><p><strong>[Data Management]</strong></p><p>You can publish metadata and manage your data through [My Data] - [Data Management].</p><img src="'+g+'" alt="\u6570\u636E\u7BA1\u7406" style="zoom:50%;"><ul><li>Metadata added through [Data Addition] will appear as \u201CUnpublished\u201D by default. After clicking on [Publish Data], the metadata will be published on Datum-platform\u2019s data market and become available to other participants. Meanwhile, its status will be changed to \u201CPublish Data\u201D.</li><li>Click on [View] to view the metadata details.</li><li>Click on [Download] to download the data uploaded to the present node to your device.</li><li>Click on [SaveAsNewData] to add a new piece of data to the node based on the published metadata. You can change the display information of the metadata before publishing.</li><li>Click on [Publish data credential] to issue Data Token based on your data.</li></ul><p><strong>[Publish Data Credential]</strong></p><p>(1) Go to [My Data] - [Publish data credential] to set the token parameters, including type, basic information, and total circulation.</p><p>You can also click on \u201CPublish data credential\u201D in [Data Management] to go to the page</p><img src="'+f+'" alt="\u53D1\u5E03\u51ED\u8BC1" style="zoom:50%;"><p>(2) Select the type of credential to be issued: \u201CNo Attribute Credentials\u201D are ERC-20 assets, while \u201CAttributed Credentials\u201D are NFTs.</p><img src="'+b+'" alt="\u9009\u62E9\u5143\u6570\u636E" style="zoom:50%;"><p>\uFF083.1\uFF09 After selecting the data for the issuance of your Data Token, go to the information setting page to set the name, symbol, total circulation, and description of the credential.</p><ul><li>\u201CName\u201D: the name of the credential seen in Datum-platform\u2019s data market.</li><li>\u201CSymbol\u201D: the symbol of the credential on the DEX.</li><li>\u201CCirculation\u201D: the total amount that can be purchased by other users. Each Credential represents the right to use the corresponding data once.</li></ul><p>After the relevant information is entered, click on [Publish Credential], complete signification confirmation for the transaction via Metamask to mint the credential.</p><img src="'+y+'" alt="Metamask\u7B7E\u540D\u786E\u8BA4-1" style="zoom:50%;"><p>\uFF083.2\uFF09<strong>Mint Attribute Credentials</strong>: After selecting the data for the issuance of your Data Token, go to the [Attribute Credential] information setting page to set the name and symbol of the credential.</p><ul><li>\u201CName\u201D: the name of the credential seen in Datum-platform\u2019s data market.</li><li>\u201CSymbol\u201D: the symbol of the credential on the trading market.</li></ul><p>After the relevant information is entered, click on [Publish Credential], and complete signification confirmation for the transaction via Metamask to mint the credential.</p><img src="'+k+'" alt="Metamask\u7B7E\u540D\u786E\u8BA4-1" style="zoom:50%;"><h2 id="my-credential" tabindex="-1"><a class="header-anchor" href="#my-credential" aria-hidden="true">#</a> <strong>My Credential</strong></h2><p><strong>[No Attribute Credential]</strong></p><ol><li><p>Click on [My Credential] - [No Attribute Credential] to view and manage the credentials you published.</p><p>Once a credential is minted, you should then bind it with data, after which you\u2019ll be able to price the credential contract and adjust the consumption amount for the corresponding application scenario. The consumption amount can only be adjusted once every 24 hours.</p><p>\uFF081\uFF09Data binding</p><img src="'+w+'" alt="\u7ED1\u5B9A\u6570\u636E" style="zoom:50%;"><p>\uFF082\uFF09Adjust consumption amount</p><img src="'+_+'" alt="\u4FEE\u6539\u6D88\u8017\u91CF" style="zoom:50%;"><p>\uFF083\uFF09Set initial price</p><p>After the credential is minted, you\u2019ll need to set the first price and provide liquidity for the DEX to complete the initial issuance.</p><p>Data Tokens will form trading pairs with LAT as the reference price.</p><img src="'+v+'" alt="\u8BBE\u7F6E\u5151\u6362\u4EF7\u683C" style="zoom:50%;"><p>After setting the first price, click on [Launch to marketplace], offer access authorization via Metamask, complete signature confirmation, and then provide liquidity of the token for the DEX.</p><img src="'+D+'" alt="Metamask\u7B7E\u540D\u786E\u8BA4-2" style="zoom:50%;"><img src="'+C+'" alt="Metamask\u7B7E\u540D\u786E\u8BA4-3" style="zoom:50%;"></li><li><p>Priced credentials with liquidity added are available on the DEX https://test.dipoleswap.exchange/</p></li></ol><p>(1) First, confirm the importation of the Token.</p><img src="'+M+'" alt="\u5BFC\u5165\u6D41\u52A8\u6027" style="zoom:39%;"><p>\u200B (2) You can check the added Token via the Swap page on the DEX and purchase the Token through Swap or adjust the Token\u2019s liquidity.</p><img src="'+z+'" alt="\u67E5\u770B\u6D41\u52A8\u6027" style="zoom:40%;"><p><strong>[Attribute Credential]</strong></p><p>\u200B 1.Click on [My Credential] - [Attribute Credential] to view and manage the credentials you published.</p><p>Once a credential is minted, you should then bind it with data, after which you\u2019ll be able to create credentials for the credential contract.</p><p>\u200B \uFF081\uFF09Data binding</p><img src="'+A+'" alt="\u7ED1\u5B9A\u6570\u636E-1" style="zoom:50%;"><p>\uFF082\uFF09Creat Credential</p><ul><li>\u201CName\u201D: the name of the credential seen in Datum-platform\u2019s data market.</li><li>\u201CExpire Date\u201D: the validity period of the credential.</li><li>&quot;Usage Scenarios&quot;: the computation types that the credentials can support.</li></ul><img src="'+N+'" alt="\u521B\u5EFA\u51ED\u8BC1" style="zoom:50%;"><p>After setting the relevant information, click on [Creat Credential], complete signification confirmation for the transaction via Metamask to accomplish the credential.<img src="'+T+'" alt="Metamask\u7B7E\u540D\u786E\u8BA4-4" style="zoom:50%;"></p><p>\uFF083\uFF09Launch</p><p>Click [Launch] button in Attribute Credential page, and choose a NFT market to launch the NFT.</p><img src="'+x+'" alt="\u4E0A\u67B6" style="zoom:50%;"><p>\uFF084\uFF09Details</p><p>Click [Detail] button in Attribute Credential page to see the detailed information.</p><img src="'+S+'" alt="\u51ED\u8BC1\u8BE6\u60C5" style="zoom:50%;">',59);function L(V,X){const o=d("ExternalLinkIcon");return i(),s("div",null,[O,t("p",null,[E,t("a",U,[F,r(o)])]),q])}const j=n(P,[["render",L],["__file","Datum-network-Help-Document(Users).html.vue"]]);export{j as default};
